import React from 'react'
import { View, Text, Button, StyleSheet } from 'react-native'

const App = () => {
  return(
    <View style={css.main}>
      <View style={css.header}>
        <Text>Hei og goddag</Text>
      </View>
      <View style={css.body}>
        <Text>Body</Text>
      </View>

    </View>
  )
}

const css = StyleSheet.create({
  main:{
    // flex:1,
    height:'60%',
  },
  header:{
    backgroundColor:'#4285F4',
    flex:1,
  },
  body:{
    backgroundColor:'orangered',
    flex:8,
  }

})

export default App
